import React, { Component } from "react";

class SignupForm extends Component {
  state = {};
  render() {
    return (
      <div>
        <div id="header">Enter your information to sign up</div>
        <div>Email</div>
        <input type="text" />
        <div>Username</div>
        <input type="text" />
        <div>Password</div>
        <input type="text" />
      </div>
    );
  }
}

export default SignupForm;
